import React, { useState } from 'react';
import { Sprout, Droplets, Clock, MapPin } from 'lucide-react';
import styles from '../styles/CropRecommendation.module.css';

const CropRecommendation = () => {
    const [loading, setLoading] = useState(false);
    const [result, setResult] = useState(null);

    const handleSubmit = (e) => {
        e.preventDefault();
        setLoading(true);
        setTimeout(() => {
            setResult([
                { name: "Wheat", score: 96, duration: "120 days", water: "Medium" },
                { name: "Mustard", score: 88, duration: "105 days", water: "Low" },
                { name: "Barley", score: 75, duration: "115 days", water: "Low" },
                { name: "Gram", score: 70, duration: "95 days", water: "Low" },
            ]);
            setLoading(false);
        }, 1500);
    };

    return (
        <div className="container">
            <h2 className="text-center" style={{ margin: '1.5rem 0' }}>Crop Recommendation</h2>

            {!result ? (
                <div className="card" style={{ maxWidth: '600px', margin: '0 auto' }}>
                    <form onSubmit={handleSubmit} className={styles.form}>
                        <div className={styles.locationBadge}>
                            <MapPin size={16} /> Auto-Location: Punjab (Detected)
                        </div>

                        <div className={styles.inputGrid}>
                            <div className={styles.inputGroup}>
                                <label>Nitrogen (N)</label>
                                <input type="number" placeholder="0-140" required />
                            </div>
                            <div className={styles.inputGroup}>
                                <label>Phosphorus (P)</label>
                                <input type="number" placeholder="0-140" required />
                            </div>
                            <div className={styles.inputGroup}>
                                <label>Potassium (K)</label>
                                <input type="number" placeholder="0-140" required />
                            </div>
                            <div className={styles.inputGroup}>
                                <label>pH Level</label>
                                <input type="number" step="0.1" placeholder="0-14" required />
                            </div>
                        </div>

                        <button disabled={loading} className={`btn btn-primary ${styles.submitBtn}`}>
                            {loading ? 'Analyzing Soil...' : 'Get Recommendation'}
                        </button>
                    </form>
                </div>
            ) : (
                <div className={styles.results}>
                    <div className={styles.topResult}>
                        <div className={styles.badge}>Best Match</div>
                        <h3>{result[0].name}</h3>
                        <div className={styles.scoreChart}>
                            <span>{result[0].score}%</span>
                            <small>Suitability</small>
                        </div>
                        <div className={styles.meta}>
                            <span><Clock size={16} /> {result[0].duration}</span>
                            <span><Droplets size={16} /> {result[0].water}</span>
                        </div>
                        <button className="btn btn-outline w-full" onClick={() => setResult(null)}>Reset</button>
                    </div>

                    <h4 style={{ marginTop: '1.5rem' }}>Other Suitable Crops</h4>
                    <div className={styles.otherList}>
                        {result.slice(1).map((crop, i) => (
                            <div key={i} className={styles.otherCard}>
                                <div className="flex justify-between items-center w-full">
                                    <span className={styles.otherName}>{crop.name}</span>
                                    <span className={styles.otherScore}>{crop.score}%</span>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            )}
        </div>
    );
};

export default CropRecommendation;
